import React from 'react'
import { Input, Row, Col, Layout, Modal, Switch } from 'antd'

export default function SimpleModal(props) {
  console.log(props.modalString)
  return (
    <div>
      <Modal
        title="Confirm"
        visible={props.visible}
        onOk={()=>props.onOk}
        onCancel={() => props.OnCancel(false)}
        okText="Confirm"
        cancelText="Cancel"
      >
      {props.modalString}
       {/* <{props.modalString /> */}
      </Modal>
    </div>
  )
}
